#Utility methods
#python str.index + len(str)
def find_after(text, self_find, start=0, end=0):
    if (end == 0):
        return (text.find(self_find, start) + len(self_find))
    else:
        return (text.find(self_find, start, end) + len(self_find))

def frequencyDictionary(frequencyList):
    returnedDictionary = {}
    donecheck = 0
    usagecounter = 0
    while (donecheck == 0):
        if (len(frequencyList) != 0):
            item = frequencyList[0]
            while ((item in frequencyList) == True):
                usagecounter = usagecounter + 1
                itemindex = frequencyList.index(item)
                frequencyList.remove(frequencyList[itemindex])
            if (type(item) == list):
                returnedDictionary[tuple(item)] = usagecounter
            else:
                returnedDictionary[item] = usagecounter
            usagecounter = 0
        else:
            donecheck = 1
    return dict(sorted(returnedDictionary.items(),key=lambda item: item[1],reverse=True))

def stringify(tup:tuple):
    return ', '.join(tup)

def sort_dict(hashmap):
    return dict(sorted(hashmap.items(),key=lambda item: item[1],reverse=True))

def len_string(maxlength, seperator):
    #for future documentation, always use len_string(Length of seperator line - 4, length of sent key)
    #The item will begin with | and a space, and end with a space, akin to file.write(f'\n| {key}{len_string(38, len(key))}|')
    spaces = (" ")
    for l in range(maxlength - seperator):
        spaces = (spaces + " ")
    return spaces

def box_string(maxlength, message, endstatement=''):
    seperator = len(message)
    returned_string = (f'| {message}')
    for i in range (maxlength - seperator -  len(endstatement) - 5):
        returned_string += " "
    return f'{returned_string} {endstatement} |'

